import React from "react";
import { Swiper, SwiperSlide } from "swiper/react";
import "swiper/swiper-bundle.min.css";
import "swiper/swiper.min.css";
import { Mousewheel, Pagination } from "swiper";
import {FiPlay } from "react-icons/fi";
import { Link } from "react-router-dom";
import "../style.css";


const Home = () => {
	return (
        <>
        <div className="sec__one slider-custom container-2">
      <Swiper
      observer={true}
      observeParents={true}
      loop={true}
       direction={"vertical"}
        slidesPerView={1}
        spaceBetween={0}
        mousewheel={true}
        pagination={{
          clickable: true,
        }}
        modules={[Mousewheel, Pagination]}
      >
        <SwiperSlide>
        <section className="header-text">
        <div className="header-left">
        <h2>Lorem ipsum</h2>
        <p>Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua. At vero eos et accusam et justo duo dolores et ea rebum. Stet clita kasd</p>
        <Link to='/about' className="home-btn">Know More<span><FiPlay/></span></Link>
        </div>
        <div className="haeder-right">
        <img
        src={`/images/header-banners.png`}
        alt="Project"
        className="slide-image"
        /> 
        </div>
        </section>
           
                
        </SwiperSlide>
        <SwiperSlide>
        <section className="header-text">
        <div className="header-left">
        <h2>Lorem ipsum</h2>
        <p>Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua. At vero eos et accusam et justo duo dolores et ea rebum. Stet clita kasd</p>
        <Link to='/about' className="home-btn">Know More<span><FiPlay/></span></Link>
        </div>
        <div className="haeder-right">
        <img
        src={`/images/header-banners.png`}
        alt="Project"
        className="slide-image"
        /> 
        </div>
        </section>
           
                
        </SwiperSlide>
      </Swiper>
        </div>
        <div className="slider-wrap conatiner-2">
       {/* <Swiper
       className={"container=222"}
       loop={true}
        slidesPerView={5}
        spaceBetween={30}
        pagination={{
          clickable: true,
        }}
        modules={[Pagination]}
      >
        <SwiperSlide className='card-box'>
        <section className='custom-slider-box'>
         <div className='card-header'>     
        <div className='card-img'>
        <img src={`../images/card-banner.jpg`} alt="Project" className="slide-image"/>
        </div>
        <div className='card-content'>
            <h4>Lorem ipsum</h4>
            <p>Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod</p>
            <Link to='/about' className="home-btn">Know More<span><FiPlay/></span></Link>
        </div>
        </div> 
        </section>
        </SwiperSlide>
        

      </Swiper> */}
      <Swiper
      observer={true}
      observeParents={true}
      loop={true}
       direction={"vertical"}
        slidesPerView={1}
        spaceBetween={0}
        mousewheel={true}
        pagination={{
          clickable: true,
        }}
        modules={[Mousewheel, Pagination]}
      >
        <SwiperSlide>
        <section className="header-text">
        <div className="header-left">
        <h2>Lorem ipsum</h2>
        <p>Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua. At vero eos et accusam et justo duo dolores et ea rebum. Stet clita kasd</p>
        <Link to='/about' className="home-btn">Know More<span><FiPlay/></span></Link>
        </div>
        <div className="haeder-right">
        <img
        src={`/images/header-banners.png`}
        alt="Project"
        className="slide-image"
        /> 
        </div>
        </section>
           
                
        </SwiperSlide>
        <SwiperSlide>
        <section className="header-text">
        <div className="header-left">
        <h2>Lorem ipsum</h2>
        <p>Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua. At vero eos et accusam et justo duo dolores et ea rebum. Stet clita kasd</p>
        <Link to='/about' className="home-btn">Know More<span><FiPlay/></span></Link>
        </div>
        <div className="haeder-right">
        <img
        src={`/images/header-banners.png`}
        alt="Project"
        className="slide-image"
        /> 
        </div>
        </section>
           
                
        </SwiperSlide>
      </Swiper>
        </div>
        </>
       )
}
export default Home;
